			,cmsCode.ICD_Code
			,cmsCode.ICD_Code_Desc
	FROM 
		#DIM_ICD_MCE_Simple_Code_Edits_FY_Range cmsCode
		INNER JOIN #CMS_FY_Release_Map cmsInfo
			ON  cmsInfo.ICD_Version = cmsCode.ICD_Version
			AND cmsInfo.CMS_Fiscal_Year BETWEEN cmsCode.CMS_Fiscal_Year_Min AND cmsCode.CMS_Fiscal_Year_Max
		INNER JOIN #MCE_Subsection_Code_Type_XWalk mceEdit
			ON  mceEdit.MCE_Edit_Type = cmsCode.MCE_Edit_Type
			AND mceEdit.ICD_Code_Type = cmsCode.ICD_Code_Type
	;'

	EXEC(@SQL)
END

